import Axios from 'axios';

export const YelpAPI = {
    search(cuisine, rating) {
      return fetch(`http://localhost:5000/api/${cuisine}/${rating}`).then(response => {
        console.log(response);
        return response.json();
      })
    },

    new() {
      return fetch(`http://localhost:5000/api/new`).then(response => {
        console.log(response);
        return response.json();
      }).catch(err => {
        console.log(err);
      })
    },

    cheap(cuisine) {
      return fetch(`http://localhost:5000/api/${cuisine}/cheap`).then(response => {
        console.log(response);
        return response.json();
      }).catch(err => {
        console.log(err);
      })
    }
}
